class Solution:
    def numDecodings(self, s: str) -> int:
        if not s:
            return 0

        n = len(s)
        ans = []
        [ans.append(0) for _ in range(n+1)]
        ans[-1] = 1
        for i in range(n-1,-1,-1):
            cur = s[i]
            ## 
            if cur =='0':
                continue
            elif cur == '*':
                ans[i] += 9 * ans[i+1]
            else:
                ans[i] += ans[i+1]
            ## 
            if i == n-1:
                continue
            else:
                if cur == '*' and s[i+1] == '*':
                    ans[i] += 15 * ans[i+2]
                elif cur == '*' and int(s[i+1])<=6:
                    ans[i] += 2 * ans[i+2]
                elif cur == '*':
                    ans[i] += ans[i+2]
                elif int(cur) == 1:
                    if s[i+1] == '*':
                        ans[i] += 9*ans[i+2]
                    else:
                        ans[i] += ans[i+2]
                elif int(cur) == 2:
                    if s[i+1] == '*':
                        ans[i] += 6*ans[i+2]
                    elif int(s[i+1]) <= 6:
                        ans[i] += ans[i+2]
                    else:
                        continue
                else:
                    continue

        # print(ans)

        return int(ans[0]%(10**9+7))
